Licensidentifikator, værende en globalt unik identifikator for en licens eller kontrakt, under hvilken varer genereres, indsendes til behandling og/eller betales for, der er konstrueret ved at sammenkæde:
 - en ISO/IEC 15459 udstedende agenturskode;
 - et licens- eller kontraktnummer, som overholder specifikationerne fra det pågældende udstedende agentur;
 og det:
 - består kun af store bogstaver og/eller numeriske tegn;
 - er unikt (det vil sige, adskiller sig fra ethvert andet ISO/IEC 15459-kompatibelt identifikator) inden for udstedende agenturs domæne;
 - kan ikke udledes fra et andet ISO/IEC 15459-kompatibelt identifikator, udstedt under samme udstedende agentur, ved simpelthen at tilføje tegn til, eller fjerne dem fra, dets ende.

