'26L' Stedkode, værende en kode, der identificerer et sted eller geografisk område, eller en tilknyttet gruppe af sådanne steder eller områder, der har relevans for en relateret transaktion og som overholder en af de strukturer, der er defineret i (a) til (f) nedenfor:
a) to store bogstaver svarende til ISO 3166-1 to alfa landekoden for det land, hvor, eller bestående af hvilket, stedet/områderne er placeret;
b) tre store bogstaver svarende til IATA-koden for lufthavnen eller byen i, tæt på, eller bestående af hvilket, stedet/områderne er placeret;
c) fire eller flere tegn, hvoraf de første tre svarer til en ISO 3166-1 landekode efterfulgt af en bindestreg (-), med resten værende et postnummer i det pågældende land;
d) fire eller flere tegn, hvoraf de første tre svarer til en ISO 3166-1 landekode efterfulgt af en prik (.), med resten værende en ISO 3166-2 landunderafdelingskode i det pågældende land;
e) fem store bogstaver svarende til UN/LOCODE for området i, tæt på, eller bestående af hvilket, stedet/områderne er placeret;
f) sammenkædningen, værende ikke mindre end syv eller mere end 35 tegn i længde, af:
- en ISO/IEC 15459 udstedende agenturskode;
- en stedkode, bestående af tegn hentet fra sættet {A-Z; 0-9} som overholder specifikationerne fra det pågældende udstedende agentur.

