Udstyrsidentifikator, værende en globalt unik identifikator for en enhed, et udstyrsstykke eller en instans af en computerapplikation, der bruges i produktionen, transporten, behandlingen eller anden håndtering af varer, der er konstrueret ved at sammenkæde:
