Udstyrsidentifikator, værende en globalt unik identifikator for en enhed, et udstyrsstykke eller en instans af en computerapplikation, der bruges i produktionen, transporten, behandlingen eller anden håndtering af varer.

UPU Placering Kode, værende en kode, der identificerer en placering eller geografisk område, eller en tilknyttet gruppe af sådanne placeringer eller områder, der har relevans for en relateret transaktion og som overholder en af de strukturer, der er defineret i a) til g) nedenfor:
a) to store bogstaver svarende til ISO 3166-1 to alfakode for landet, hvor, eller bestående af hvilket, placering(en) eller område(r) er placeret;
b) tre store bogstaver svarende til IATA-koden for lufthavnen eller byen i, tæt på, eller bestående af hvilket placering(en) eller område(r) er placeret;
c) fire eller flere tegn, hvoraf de første tre svarer til en ISO 3166-1 landekode efterfulgt af en bindestreg (-), med resten værende et postnummer i det pågældende land;
d) fire eller flere tegn, hvoraf de første tre svarer til en ISO 3166-1 landekode efterfulgt af en prik (.), med resten værende en ISO 3166-2 landunderafdelingskode i det pågældende land;
e) fem store bogstaver svarende til UN/LOCODE for området i, tæt på, eller bestående af hvilket, placering(en) eller område(r) er placeret;
f) seks store alfanumeriske tegn svarende til en UPU IMPC-kode tildelt i overensstemmelse med UPU standard S34;
g) sammenkædningen, værende ikke mindre end syv eller mere end 25 tegn i længden, af:
 - en udstederkode tildelt i overensstemmelse med UPU standarder S31;
 - en placering kode, bestående af tegn trukket fra sættet {A-Z; 0-9} som overholder specifikationerne for den pågældende udsteder.

Nummerplade med Service Data og Placering Kode er en sammensat datakonstrukt, i overensstemmelse med specifikationen i UPU standard S25, som inkluderer specifikation af:
 - en ISO/IEC 15459-kompatibel vareidentifikator;
 - en dataidentifikator 5U-kompatibel specifikation af den service, der skal leveres med hensyn til varen;
 - en dataidentifikator 17U-kompatibel UPU placering kode eller en dataidentifikator 18U-kompatibel kvalificeret UPU placering kode.
 Bemærk - For yderligere detaljer, henvises til UPU standard S25. Forskellen mellem en simpel UPU placering kode (DI 17U) og en kvalificeret UPU placering kode (DI 18U) kan bestemmes ud fra det første tegn. Hvis dette er numerisk, gælder 18U; hvis det er alfabetisk, gælder 17U.

