Dato, repræsenteret i modificeret UTC-kompatibel form:
åååå[mm[dd[tt[mm[ss[fff]]]]]][poooo] hvor firkantede parenteser indikerer valgfrihed og åååå er året, mmdd måneden og dagen, ttmmss tidspunktet på dagen i timer minutter og sekunder, fff brøkdele af sekunder og poooo forskellen fra UTC udtrykt i timer og minutter, forskellen er positiv hvis p er et punktum (.), negativ hvis P er et minus tegn (-).
