200505181247.0100 - 12:47 lokal tid, svarende til 11:47 UTC, den 18. maj 2005;
20050518124723099 - 99 millisekunder efter 12:47:23 UTC den 18. maj 2005.

Kvalificeret dato, bestående af sammenkædningen af:
- en ISO/IEC 15459 udstedende agenturs kode;
- en dato kvalifikator i overensstemmelse med specifikationerne fra det udstedende agentur;
- en dato hvis format og fortolkning overholder specifikationerne fra det udstedende agentur for den pågældende dato kvalifikator.

Erklæring af emballagemateriale kategori*, kode* og vægt for et givent emballagemateriale anvendt i en given emballage i henhold til EU's emballage- og emballageaffaldsdirektiv. (Materialekategori og kode defineret i bilag M).
12ECCMMMMMMNNNNNUU hvor: - '12E' (an3) er dataidentifikatoren;
 - 'CC' (n2) er materialekategorien per bilag M;
 - 'MMMMMM' (an1...6) er materialekoden per bilag M;
 - 'NNNNN' (n5) materiale vægt, inklusive decimalpunkt (f.eks., 12.12);
 - 'UU' (an2) er vægtenheden (f.eks., KG, GR, LB eller OZ per ANSI X12.3 som i bilag D).

