Modtager nummer.
Det unikke identificerende nummer kan være IRS, EIN, SSN eller det af CBP tildelte nummer, som krævet på Security Filing. Kun følgende formater skal bruges: IRS EIN: NN-NNNNNNN;
IRS EIN m/ suffix:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP tildelt nbr: YYDDPP-NNNNN.
